const input = [
  '',
  '',
  '',
  '',
  '',
];
/*
const input = [
  'ULL',
  'RRDDD',
  'LURDL',
  'UUUUD',
];
*/

const GRID = [
  [false, false, 1, false, false],
  [false, 2, 3, 4, false],
  [5, 6, 7, 8, 9],
  [false, 'A', 'B', 'C', false],
  [false, false, 'D', false, false],
];

let currentPosition = [2, 0];
let code = [];

input.map(move => {
  for (var i = 0; i < move.length; i++) {
    let m = move[i];

    if (m === 'U' && currentPosition[0] > 0 && GRID[currentPosition[0] - 1][currentPosition[1]]) {
      currentPosition = [currentPosition[0] - 1, currentPosition[1]];
    } else if (m === 'L' &&  currentPosition[1] > 0 && GRID[currentPosition[0]][currentPosition[1] - 1]) {
      currentPosition = [currentPosition[0], currentPosition[1] - 1];
    } else if (m === 'D' && currentPosition[0] < (GRID.length - 1) && GRID[currentPosition[0] + 1][currentPosition[1]]) {
      currentPosition = [currentPosition[0] + 1, currentPosition[1]];
    } else if (m === 'R' && currentPosition[1] < (GRID.length - 1) && GRID[currentPosition[0]][currentPosition[1] + 1]) {
      currentPosition = [currentPosition[0], currentPosition[1] + 1];
    }

    // console.log(currentPosition);
  }

  code.push(GRID[currentPosition[0]][currentPosition[1]]);
});

console.log(code);
